import React from "react";
import "./App.css";
import FoodMenu from "./pages/home.js";
import Header from "./components/Header";

function App() {
  return (
    <div className="App">
      <Header />
      <img src="./src/images/falafel.jpg" alt="falafel" />
      <FoodMenu />
    </div>
  );
}

export default App;
